#sigmoid function
def maxIndex(array):
    i = 0
    maxx = max(array)
    for i in range(0,len(array)):
        if array[i] == maxx:
            return i

def sigmoid(x):
    if x >100:
        return 1
    if x < -100:
        return 0
    return 1.0/(1.0+ math.pow(math.e,-x))

def compute(numbersOfNodes,inputVector,W,W0):
    O = []
    O.append(inputVector)

    for i in range(1,len(numbersOfNodes)):
        level1 = []
        for j in range(0,numbersOfNodes[i]):
            level1.append(0.0)
        O.append(level1)


    for i in range(1,len(numbersOfNodes)):
        for k in range(0,numbersOfNodes[i]):
            summ = W0[i-1][k]
            for j in range(0,numbersOfNodes[i - 1]):
                summ += W[i - 1][j][k] * O[i - 1][j]
            O[i][k] = sigmoid(summ)
    return O[-1]

def positionOfGang(index,string):
    numberOfIndex = 0
    for i in range(0,len(string)):
        if string[i] == "_":
            numberOfIndex += 1
        if numberOfIndex == index:
            return i
    return -1






